import React from "react";
import {ProfileWrapper} from "./ProfileCompoent_style";

interface Props {
    username: string;
    description: string;
}


export const ProfileComponent: React.FC<Props> = (Props) => {
    return(

    <ProfileWrapper>
        <div className="container">
            <div className="card">
                <h2>Profile Page</h2>
                <p> Description </p>
            </div>

        </div>
    </ProfileWrapper>

    );
};

export default ProfileComponent;
